import React from 'react';
import './App.css';
import Header from './components/Header/Header';
import Shop from './components/Shop/Shop';
import { Routes, Route, Outlet, Link } from "react-router-dom";


function App() {
  return (
    <div>
      <Header></Header>       
      <Routes>
        <Route path="/" element={<App/>}>
        </Route>
      </Routes>


    </div>
  );
}


export default App;
